import React from "react";
import { Box, Container, Typography } from "@mui/material";

export const Home = () => {
  return (
    <>
      <Container>
        <Box sx={{marginTop:'5rem'}}>
          <Box
            sx={{
              margin: "auto",
              height: "450px",
              width: "350px",
              border: "1px solid grey",
              padding: "25px 39px 25px 39px"
            }}
          >
            <Typography variant="h3" sx={{ color: "black" }}>Instagram</Typography>
          </Box>
        </Box>
      </Container>
    </>
  );
};
